import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LandingPage from './pages/Landing';
import QuickCheck from './pages/blacklist/QuickCheck';
import Login from './pages/Login';
import Layout from './layouts/dashboard/Layout';
import Home from './pages/dashboard/Home';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="" element={<LandingPage />} />
        <Route path="quick-check" element={<QuickCheck />} />
        <Route path="login" element={<Login />} />
        <Route path="dashboard" element={<Layout />}>
          {/* Fix the typo in the next line, change 'paht' to 'path' */}
          <Route path="home" element={<Home />} />
        </Route>
        {/* If you want a default route, you can provide a 'catch-all' Route */}
        <Route path="*" element={<NotFoundPage />} />
      </Routes>
    </Router>
  );
}

export default App;
